import './App.css';
import Preloader from './Components/Utilities/Preloader';
import { Route, Routes } from 'react-router-dom';
import HomePage from './Components/Pages/Home/HomePage'
import AboutUs from './Components/Pages/AboutUs';
import Gallery from './Components/Pages/Gallery';
import NavBar from './Components/Utilities/NavBar';
import TeamGallery from './Components/Utilities/TeamGallery'
import images from './Components/Utilities/ImageDirectories/16TeamsPhotos.json'
import { useRoutes } from 'react-router-dom';

function App() {
  let imageIds = [];
  for (let i = 0; i < images.length; i++) {
    imageIds.push(images[i].link);
  }

  const routes = 
  <Routes>
    {imageIds.map((imageLink, index) => (
      <Route key={index} path={`/gallery/${imageLink}`} element={<TeamGallery />} />
    ))}
  </Routes>


  const routing = useRoutes(routes);

  return (
    <div>
      <Routes>
        <Route path="/" element={<Preloader />} />
        <Route path="/homepage" element={<HomePage />} />
        <Route path="/gallery" element={<Gallery />} />
        {routing}
      </Routes>
    </div>
  );
}

export default App;
